-- 1. Find Total Profit in superstore dataset

SELECT SUM(Profit) FROM sales_data;

-- 2. Find Top 5 Categories by Sales in superstote dataset

SELECT Category, SUM(Sales) AS Total_Sales
FROM sales_data
GROUP BY Category
ORDER BY Total_Sales DESC
LIMIT 3;

-- 3. Find the Number of Orders per Ship Mode in superstore dataset

SELECT Ship_Mode, COUNT(DISTINCT Order_ID) AS Number_Of_Orders
FROM sales_data
GROUP BY Ship_Mode;

-- 4 Find the Average Discount in superstore data
SELECT AVG(Discount) FROM sales_data;

-- 5 Find the Top 5 Product Names by Sales in superstore dataset

SELECT Product_Name, SUM(Sales) AS Total_Sales
FROM sales_data
GROUP BY Product_Name
ORDER BY Total_Sales DESC
LIMIT 5;

-- 6Find the  Orders by Order Date First 10 in superstore

SELECT Order_Date, COUNT(DISTINCT Order_ID) AS Number_Of_Orders
FROM sales_data
GROUP BY Order_Date
ORDER BY Order_Date ASC
LIMIT 10;

-- 7 Find the Total Quantity and Sales for 'Furniture' Category

SELECT Category, SUM(Quantity) AS Total_Quantity, SUM(Sales) AS Total_Sales
FROM sales_data
WHERE Category = 'Furniture'
GROUP BY Category;

-- 8 Find the Customers with Total Sales over $1000 
SELECT Customer_Name, SUM(Sales) AS Total_Sales
FROM sales_data
GROUP BY Customer_Name
HAVING SUM(Sales) > 1000
ORDER BY Total_Sales DESC;

-- 9 Find the Top 5 States by Sales and Profit
SELECT State, SUM(Sales) AS Total_Sales, SUM(Profit) AS Total_Profit
FROM sales_data
GROUP BY State
ORDER BY Total_Sales DESC
LIMIT 5;

-- 10 Find the Technology Category Performance
SELECT SUM(Sales) AS Total_Sales, SUM(Profit) AS Total_Profit, AVG(Sales) AS Average_Sales
FROM sales_data
WHERE Category = 'Technology';